window.bookSummaryJSON = "<p>Welcome to the Black Rose Auction where every sin can be yours for a price.</p> <p>For three days, the doors to this luxe New York estate are thrown wide for anyone with a taste for the obscenely rich, the ultra-exclusive, and the once in a lifetime thrill of the forbidden: where nothing is off the table and everything and everyone can be had for the taking.</p> <p>In WICKED PURSUIT by Katee Robert, a Little Red Riding Hood remix, a mob princess with a taste for doing things she shouldn't acquires a stalker who will kill anyone who touches what's his...</p>"; 
